<script>
import bgHome from '~/assets/img/bg-home.jpg';
import { createConfig, responseManager } from '~/service/api-manager';
export default {
  name: 'StudentPage',
  data() {
    return {
      bgImg: bgHome,
      absen: false,
      lastAbsent: ''
    };
  },
  mounted() {
    this.fetchAbsent();
    this.fetchLastAbsent();
  },
  methods: {
    async fetchAbsent() {
      try {
        const { data: resData } = await this.$axios(
          // eslint-disable-next-line new-cap
          new createConfig().getData({
            url: 'presensi/check'
          })
        );
        this.absen = resData.data.absen;
      } catch (error) {
        console.log(error);
        // eslint-disable-next-line new-cap
        const err = new responseManager().manageError(error);
        this.$toast.show(err?.error || err.message, {
          position: 'top-center',
          type: 'error',
          duration: 5000,
          theme: 'bubble',
          singleton: true
        });
      }
    },
    async fetchLastAbsent() {
      try {
        const { data: res } = await this.$axios(
          // eslint-disable-next-line new-cap
          new createConfig().getData({
            url: 'presensi/last'
          })
        );
        if (res.data === null) {
          this.lastAbsent = 'Absent Yet';
        } else {
          this.lastAbsent = res.data.dateSubmit;
        }
      } catch (error) {
        console.log(error);
        // eslint-disable-next-line new-cap
        const err = new responseManager().manageError(error);
        this.$toast.show(err?.error || err.message, {
          position: 'top-center',
          type: 'error',
          duration: 5000,
          theme: 'bubble',
          singleton: true
        });
      }
    }
  }
};
</script>

